import Link from 'next/link';
import Header from '../components/Header';
export default function Index() {
  return (
    <div>
      <Header />
      <p>Hello Next.js</p>
      <Link href="/about">
        <a title="About Page">About Page</a>
      </Link>
    </div>
  );
}
